function palindrome(str) {

  //remove all punctuation and spaces
  var str1 = str.replace(/[^A-Za-z0-9]/g, '');
  //make all lower case
  var str2 = str1.toLowerCase();
  console.log(str2);

  var str3 = str2.split('').reverse().join('');
  console.log(str3);

  if (str2 === str3)
  {
    return true;
  }

  else
  {  
    return false;
  }
}



