function rot13(str) { // LBH QVQ VG!
  //var arr0 = str.split("");
  var arr = [];
  var arr2 = [];
  var newstr = "";
  //concat array to string
  //var str3 = String.fromCharCode(65);
  //var str2 = 'did'.charCodeAt(0);

 for (i=0; i<str.length; i++)
 {
    var filler = 0;
    if (str.charCodeAt(i) >= 65 && str.charCodeAt(i) <= 77) //A-M
    {
      filler = str.charCodeAt(i) + 13;
      arr.push(filler);
    }
    else if (str.charCodeAt(i) > 77 && str.charCodeAt(i) <= 90) //N-Z
    {
      filler = str.charCodeAt(i) - 13;
      arr.push(filler);
    }
    else //all other characters !, .*?
    {
      filler = str.charCodeAt(i);
      arr.push(filler);
    }
 }

 for (j=0; j<str.length; j++)
 {
   var placeme = String.fromCharCode(arr[j]);
   arr2.push(placeme);
 }


  newstr = arr2.join("");
  return newstr;
}

