function convertToRoman(num) {
  var newArr = [];
  var result;

  while (num>=1000) {
    newArr.push("M"); 
    num -= 1000;
  }

  if (num >= 900) {
    newArr.push("CM");
    num -= 900;
  }

  if (num >= 500) {
    newArr.push("D");
    num -= 500;
  }

  if (num >= 400) {
    newArr.push("CD");
    num -= 400;
  }

  while (num >= 100) { 
    newArr.push("C");
    num -= 100;
  }

  if (num >= 90) {
    newArr.push("XC");
    num -= 90;
  }

  if (num >= 50) {
    newArr.push("L");
    num -= 50;
  }

  if (num >= 40) {
    newArr.push("XL");
    num -= 40;
  }

  while (num >= 10) {
    newArr.push("X");
    num -= 10;
  }

  if (num >= 9) {
    newArr.push("IX");
    num -= 9;
  }

  if (num >= 5) {
    newArr.push("V");
    num -= 5;
  }

  if (num >= 4) {
    newArr.push("IV");
    num -= 4;
  }

  while (num > 0) {
    newArr.push("I");
    num -= 1;
  }

  result = newArr.join();
  result = result.replace(/,/g,"");
  console.log(result);
  return result;
}

convertToRoman(36);

function telephoneCheck(str) {

  var tests = /^(1|1[\s-])?(\d{3}|\d{3}[\s-]|\(\d{3}\)|\(\d{3}\)\s)(\d{3}|\d{3}[\s-])\d{4}$/g;
  return tests.test(str);
}



telephoneCheck("555-555-5555");

function checkCashRegister(price, cash, cid) {
  var changeleft = Math.round((cash-price)*100)/100, changetotal = Math.round((cash-price)*100)/100, totalcid = 0, arr = [], temp = 0, temp2 = 0;

  var values = [["PENNY", 0.01], 
                ["NICKEL", 0.05], 
                ["DIME", 0.10], 
                ["QUARTER", 0.25], 
                ["ONE", 1.00], 
                ["FIVE", 5.00], 
                ["TEN", 10.00], 
                ["TWENTY", 20.00], 
                ["ONE HUNDRED", 100.00]];

  //this get the cash in the till
  for(var i=0; i<cid.length; i++) {
    totalcid += Math.round(cid[i][1]*100)/100;
  }

  if(totalcid < changeleft) {
    return "Insufficient Funds";
  }

  function getchange(j,value) {
    temp=0;
    while(changeleft >= value && cid[j][1] >= value) {
      changeleft = Math.round((changeleft-value)*100)/100;
      cid[j][1] = Math.round((cid[j][1]-value)*100)/ 100;
      totalcid = Math.round((totalcid-value)*100)/100;
      temp = Math.round((temp+value)*100)/100;
    }
    temp2 = Math.round((temp2+temp)*100)/100;
    if(temp !== 0) {
      arr.push([values[j][0],temp]);
    }
  }

  for(var k=8; k>=0; k--) {
    getchange(k, values[k][1]);
  }

  if(temp2 < changetotal) {
    return "Insufficient Funds";
  }
  if(totalcid !== 0) {
    return arr;
  } else {
    return "Closed";
  }
}
